'''Snape grass''' is an item used in the making of [[prayer potion]]s and [[fishing potion]]s. It is also used when making a [[hangover cure]], which is needed in the [[Plague City]] [[Quests|quest]] and the [[Skippy and the Mogres]] [[Miniquests|miniquest]], and may be required in [[Fairytale I - Growing Pains]].

According to the book [[Gielinor's flora - allotments]], snape grass has a subtle fruity flavour and is often used in teas. When crushed, the leaves emit a fruit smell which can be used to repel some insects, but interestingly has been known to attract bees. In addition, the leaves change colour from green to red during changing autumn temperatures, but this does not occur in game.

==Farming==
Snape grass can be farmed at level 61 [[Farming]] in an [[allotment]] using [[snape grass seed]]s. They give 82 experience for planting and 82 per Snape grass harvested. Players can pay a gardener 5 [[jangerberries]] to protect their patches of snape grass. Alternatively, at level 58 Farming players can plant a [[White lily]] in the flower patch to protect the snape grass.

When placed in a [[Compost Bin|compost bin]], snape grass will create [[supercompost]].

